import { Meteor } from 'meteor/meteor';
import { Mongo } from 'meteor/mongo';
import React, { Component } from 'react';
import { render } from 'react-dom';
import TrackerReact from 'meteor/ultimatejs:tracker-react';
import { withTracker } from 'meteor/react-meteor-data';
import Validation from 'react-validation';
import validator from 'validator';
import {Tracker} from 'meteor/tracker';
import { browserHistory } from 'react-router'; 
import { Link } from 'react-router';
import { TicketMaster } from '../../website/ServiceProcess/api/TicketMaster.js';

class UserInformation extends TrackerReact(Component){
	render(){
    return(            
      <div className="userInformationWrapper col-lg-6 col-md-6 col-sm-6 col-xs-6">

      </div>    
    );
   }
}
UserInfoContainer = withTracker(({params}) => {
    var _id          = params.id;
    const postHandle = Meteor.subscribe('singleTicket',_id);    
    const ticket     = TicketMaster.findOne({"_id":_id})|| {};
    const loading    = !postHandle.ready();

    if(_id){
      return {
          loading,
          ticket,
      };
    }
})(UserInformation);

export default UserInfoContainer;
